(79, 'widget_text', 'a:8:{i:2;a:4:{s:5:\"title\";s:21:\"Найдите нас\";s:4:\"text\";s:226:\"<strong>Адрес</strong>\n123 Мейн стрит\nНью Йорк, NY 10001\n\n<strong>Часы</strong>\nПонедельник&mdash;пятница: 9:00&ndash;17:00\nСуббота и воскресенье: 11:00&ndash;15:00\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:3;a:4:{s:5:\"title\";s:13:\"О сайте\";s:4:\"text\";s:205:\"Здесь может быть отличное место для того, чтобы представить себя, свой сайт или выразить какие-то благодарности.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:4;a:4:{s:5:\"title\";s:21:\"Найдите нас\";s:4:\"text\";s:226:\"<strong>Адрес</strong>\n123 Мейн стрит\nНью Йорк, NY 10001\n\n<strong>Часы</strong>\nПонедельник&mdash;пятница: 9:00&ndash;17:00\nСуббота и воскресенье: 11:00&ndash;15:00\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:5;a:4:{s:5:\"title\";s:13:\"О сайте\";s:4:\"text\";s:205:\"Здесь может быть отличное место для того, чтобы представить себя, свой сайт или выразить какие-то благодарности.\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:6;a:4:{s:5:\"title\";s:5:\"About\";s:4:\"text\";s:94:\"Мы удобная доска объявлений для Государства Алания\";s:6:\"filter\";b:0;s:6:\"visual\";b:0;}i:7;a:3:{s:5:\"title\";s:5:\"About\";s:4:\"text\";s:330:\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam ipsum turpis, rutrum id mattis a, feugiat et nisi. Cras posuere lacinia mi id luctus. Pellentesque elementum arcu in dapibus lacinia. Nam molestie nisl vel tristique imperdiet. Quisque mollis malesuada ipsum, sit amet pharetra urna posuere vitae. In id risus neque.\";s:6:\"filter\";b:0;}i:8;a:3:{s:5:\"title\";s:5:\"About\";s:4:\"text\";s:1036:\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse malesuada justo ut dui porta feugiat. Duis volutpat nisi id varius placerat. Nam rutrum bibendum leo. Curabitur in tincidunt mi.\r\n<div class=\"social-network\">\r\n                        <h6>Social network</h6>\r\n                        <a href=\"#\" class=\"social-icon social-icon-sm footer-socia