iders/packages/webshopworks-popups/join-the-community.jpg\";}}s:16:\"important_notice\";a:9:{s:4:\"date\";s:10:\"2020-05-25\";s:5:\"title\";s:57:\"IMPORTANT: LayerSlider update required &amp; special sale\";s:7:\"message\";s:868:\"You’re using an outdated version of LayerSlider, which lacks crucial fixes. You need to update to LayerSlider 6.11 or newer to be compatible with the latest versions of WordPress and popular 3rd party applications. New updates contain important security fixes, new features and content, countless improvements and bug fixes. Updating is necessary to use the product as intended.<br><br>Please refer to our online documentation for <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/documentation/#updating\">updating instructions</a>. Don’t own a license yet? <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/pricing/\">Purchase LayerSlider</a> now with 20% OFF using the promo code <b>UPDATE20</b> during checkout. Please <a target=\"_blank\" href=\"https://layerslider.kreaturamedia.com/contact/\">contact us</a> if you’re having questions.\";s:5:\"image\";s:0:\"\";s:6:\"banner\";a:5:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:132:\"height: auto; margin: 39px auto 0 auto !important; min-width: 700px; max-width: 1700px; padding-right: 20px; box-sizing: border-box;\";s:3:\"url\";s:0:\"\";s:6:\"target\";s:6:\"_blank\";s:7:\"content\";s:3445:\"\n\n		<style>\n		@import url(\"https://fonts.googleapis.com/css2?family=Nunito:wght@400;600;800&display=swap\");\n		</style>\n		<style>\n\n			#lspr-inner {\n				position: relative;\n				height: auto;\n				margin: 0 auto !important;\n				background: #ff4d65;\n				background: linear-gradient(to right, #ff4d65 0%,#ff894d 100%);\n				border-radius: 1rem;\n				border-radius: calc( 0.5rem + 0.5vw );\n			}\n\n			#lspr-heading-small {\n				padding: 0 3rem;\n				padding-top: 1.5rem;\n				padding-top: calc( 1rem + 0.5vw );\n				text-align: center;\n				color: rgba(255,255,255,.75);\n				font-size: 1rem;\n				font-size: calc( 1rem + 0.5vw );\n				font-family: Nunito, sans-serif;\n				line-height: normal;\n			}\n\n			#lspr-heading {\n				margin-top: 0.15rem;\n				margin-top: 0.2vw;\n				padding: 0 3rem;\n				text-align: center;\n				color: white;\n				font-size: 1.5rem;\n				font-weight: 600;\n				line-height: 2rem;\n				font-size: calc( 1.5rem + 0.6vw );\n				font-family: Nunito, sans-serif;\n			}\n\n			.lspr-nowrap {\n				white-space: nowrap;\n			}\n\n			.lspr-text {\n				position: relative;\n				z-index: 200;\n				margin: 0.5rem auto 0 auto;\n				padding: 0.3rem 3rem;\n				color: white;\n				font-family: Nunito, sans-serif;\n				font-size: 1.2rem;\n				font-size: calc( 0.7rem + 0.5vw );\n				line-height: normal;\n				text-align: justify;\n			}\n\n			#lspr-buttons {\n				text-align: center;\n				padding-bottom: 2rem;\n				padding-bottom: calc( 1rem + 0.5vw );\n			}\n\n			#lspr-buttons a {\n				margin: 1rem 1rem 0;\n				text-decoration: none;\n				color: #ff4d65;\n				text-transform: uppercase;\n				font-family: Nunito, sans-serif;\n				font-weight: 800;\n				display: inline-block;\n				border-radius: 100px;\n				background-color: white;\n				padding: 0 1.5rem;\n				line-height: 2.4rem;\n				line-height: calc( 1.8rem + 0.5vw );\n				font-size: 1.1rem;\n				font-size: calc( 0.8rem + 0.25vw);\n				transform: rotate(0.0001deg);\n				transition: all 0.2s;\n				box-shadow: none;\n			}\n\n			#lspr-buttons a:hover {\n				transform: rotate(0.001deg) scale(1.05);\n				box-shadow: 0 0.25vw 0.5vw rgba(0,0,0,0.15);\n			}\n\n			.layerslider_notice_img  .dashicons-dismiss {\n				right: 30px;\n			}\n\n			.lspr-bold {\n				font-weight: 800 !important;\n			}\n\n		</style>\n		<div id=\"lspr-inner\">\n			<div id=\"lspr-heading-small\"></div>\n			<div id=\"lspr-heading\">\n				<span class=\"lspr-nowrap\">UPDATE REQUIRED &amp;<br>LAYERSLIDER SPECIAL SALE<span>\n			</div>\n\n			<div class=\"lspr-text\">\n				<span>You’re using an outdated version of LayerSlider, which lacks crucial fixes. You need to update to LayerSlider 6.11 or newer to be compatible with the latest versions of WordPress and popular 3rd party applications. New updates contain important security fixes, new features and content, countless improvements and bug fixes. Updating is necessary to use the product as intended.\n				</span>\n			</div>\n\n			<div class=\"lspr-text\">\n				<span>Updating is free for everyone. Check our \"How to Update\" guide for more information. We’re also running an update sale, and you can grab a license 20% OFF using the promo code <b class=\"lspr-bold\">UPDATE20</b> during checkout.\n				</span>\n			</div>\n\n			<div id=\"lspr-buttons\">\n				<a href=\"https://layerslider.kreaturamedia.com/how-to-update/\" target=\"_blank\">How to update</a>\n				<a href=\"https://layerslider.kreaturamedia.com/pricing/\" target=\"_blank\">Get special deal now</a>\n				<a href=\"https://layerslider.kreaturamedia.com/contact/\" target=\"_blank\">Contact us</a>\n			</div>\n		</div>\n		\";}s:11:\"min_version\";s:0:\"\";s:11:\"max_version\";s:6:\"6.10.2\";s:11:\"unactivated\";b:0;s:10:\"url_filter\";s:33:\"layerslider index.php plugins.php\";}}', 'no');
