(1557, 1, '2020-05-15 14:43:23', '2020-05-15 11:43:23', 'G-класс был разработан в качестве военного транспортного средства по предложению иранского шаха Мохаммеда Реза Пехлеви[1][3][4], в то время являвшегося акционером компании Mercedes-Benz. Гражданская версия автомобиля была представлена в 1979 году.\r\n\r\nВ отличие от иных серий транспортных средств торговой марки Mercedes-Benz, автомобили G-класса сохраняют свой уникальный внешний вид независимо от модификации, будь то заводская или высокопроизводительная от подразделения Mercedes-AMG, уже на протяжении нескольких десятилетий[3].', 'Mercedes', '', 'inherit', 'closed', 'closed', '', '1490-revision-v1', '', '', '2020-05-15 14:43:23', '2020-05-15 11:43:23', '', 1490, 'http://wordpress/1490-revision-v1/', 0, 'revision', '', 0),
