(1578, 1, '2020-05-28 14:23:09', '0000-00-00 00:00:00', '<!-- wp:heading {\"level\":3} -->\n<h3><br>1. Объявление должно быть законным</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Не размещайте в объявлениях предложения, условия или информацию, нарушающие законодательство Российской Федерации или права третьих лиц, либо способствующие таким нарушениям.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы вправе размещать объявления только о тех товарах, услугах, вакансиях, объектах и других предложениях (далее – «товар»), в отношении которых у вас есть все необходимые права, лицензии, регистрации, разрешения, сертификаты и т.п.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>До размещения объявления вы обязаны убедиться в законности всех его элементов (включая фотографии, видео, ссылки на сторонние сайты, когда они допустимы, и т.п.). За любые допущенные вами нарушения законодательства или прав третьих лиц вы будете нести ответственность самостоятельно.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>2. Информация в объявлении должна быть достоверной и полной</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Мы рассматриваем как грубое нарушение правил  размещение в объявлении любой информации, которая может ввести в заблуждение относительно вашего товара или условий вашего предложения.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Если ваше предложение должно в силу закона содержать какие-либо сведения, вы обязаны их указать.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы самостоятельно несете всю ответственность за распространение объявления, в котором отсутствуют обязательные сведения или указана недостоверная информация.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>3. Объявление должно соответствовать категориям </h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Размещайте объявления только о тех товарах, для которых на Авито существует тематическая категория. Не размещайте объявления о принятии в дар, заказе услуг, сборе материальной помощи, знакомствах, находке, потере, покупке или поиске. Исключения: объявление о покупке недвижимости вы можете разместить только в категории&nbsp;<em>«Недвижимость»</em> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы можете разместить несколько товаров в одном объявлении, только если они составляют комплект или соответствуют одной категории. Например, вы можете предложить в одном объявлении в категории&nbsp;<em>«Охота и рыбалка»</em>&nbsp;удочку и костюм для дайвинга, но не можете предложить в нем автомобиль для езды на рыбалку. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы можете размещать объявления в рамках одной категории с использованием только одного профиля (в том числе, если вы действуете в рамках одной компании или совместного бизнеса).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Начните писать или нажмите / для выбора блока</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>4. Предложение должно быть конкретным, существующим и актуальным</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Размещайте объявления о конкретном существующем имеющем потребительскую ценность товаре. Если вы размещаете объявление о продаже товара – вы должны быть готовы передать его покупателю,  и т.д. Например, нельзя продать дырку от бублика или сдать в аренду квартиру на планете Сатурн. Помните, что размещение объявления может повлечь для вас обязательство перед потенциальным покупателем заключить и исполнить сделку в соответствии с гражданским законодательством.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Если вы продали товар или ваше предложение перестало быть актуальным по другим причинам, снимите объявление с публикации как можно скорее. Не изменяйте содержание ранее опубликованного объявления – для нового предложения создайте новое объявление.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Не размещайте объявления о продаже товаров через аукцион или с торгов. Исключение: в категориях&nbsp;<em>«Недвижимость»</em>&nbsp;и&nbsp;<em>«Транспорт»</em>(кроме подкатегории<em>&nbsp;«Материал»</em>) вы можете разместить объявление о продаже через аукцион при условии, что в объявлении есть прямое указание на данное условие продажи.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Не размещайте в объявлениях информацию общего рекламного характера без конкретного предложения. По вопросам рекламы обращайтесь непосредственно к нам.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>5. Запрещено размещать повторные объявления</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Вы можете разместить только одно действующее объявление для одного товара.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Это означает, что вы не можете размещать повторные объявления (дубли) о предложении одного и того же товара в разных городах или районах.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы также не можете размещать повторные объявления (дубли) о предложении одного и того же товара с использованием нескольких профилей (в том числе, если вы действуете в рамках одной компании или совместного бизнеса). Исключение: в категории «<em>Недвижимость</em>» допускается одновременное размещение объекта недвижимости собственником и уполномоченным агентством. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Начните писать или нажмите / для выбора блока</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>При совпадении параметров объявления с аналогичными параметрами другого ранее размещенного объявления, более позднее объявление может быть расценено как повторное и заблокировано.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Подача объявлений происходит в течении 24 часов.<br></p>\n<!-- /wp:paragraph -->', 'Правила подачи объявлений', '', 'draft', 'closed', 'closed', '', '', '', '', '2020-05-28 14:23:09', '2020-05-28 11:23:09', '', 0, 'http://wordpress/?page_id=1578', 0, 'page', '', 0),
(1579, 1, '2020-05-28 14:22:44', '2020-05-28 11:22:44', '<!-- wp:heading {\"level\":3} -->\n<h3><br>1. Объявление должно быть законным</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Не размещайте в объявлениях предложения, условия или информацию, нарушающие законодательство Российской Федерации или права третьих лиц, либо способствующие таким нарушениям.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы вправе размещать объявления только о тех товарах, услугах, вакансиях, объектах и других предложениях (далее – «товар»), в отношении которых у вас есть все необходимые права, лицензии, регистрации, разрешения, сертификаты и т.п.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>До размещения объявления вы обязаны убедиться в законности всех его элементов (включая фотографии, видео, ссылки на сторонние сайты, когда они допустимы, и т.п.). За любые допущенные вами нарушения законодательства или прав третьих лиц вы будете нести ответственность самостоятельно.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>2. Информация в объявлении должна быть достоверной и полной</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Мы рассматриваем как грубое нарушение правил  размещение в объявлении любой информации, которая может ввести в заблуждение относительно вашего товара или условий вашего предложения.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Если ваше предложение должно в силу закона содержать какие-либо сведения, вы обязаны их указать.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы самостоятельно несете всю ответственность за распространение объявления, в котором отсутствуют обязательные сведения или указана недостоверная информация.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>3. Объявление должно соответствовать категориям </h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Размещайте объявления только о тех товарах, для которых на Авито существует тематическая категория. Не размещайте объявления о принятии в дар, заказе услуг, сборе материальной помощи, знакомствах, находке, потере, покупке или поиске. Исключения: объявление о покупке недвижимости вы можете разместить только в категории&nbsp;<em>«Недвижимость»</em> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы можете разместить несколько товаров в одном объявлении, только если они составляют комплект или соответствуют одной категории. Например, вы можете предложить в одном объявлении в категории&nbsp;<em>«Охота и рыбалка»</em>&nbsp;удочку и костюм для дайвинга, но не можете предложить в нем автомобиль для езды на рыбалку. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы можете размещать объявления в рамках одной категории с использованием только одного профиля (в том числе, если вы действуете в рамках одной компании или совместного бизнеса).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Начните писать или нажмите / для выбора блока</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>4. Предложение должно быть конкретным, существующим и актуальным</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Размещайте объявления о конкретном существующем имеющем потребительскую ценность товаре. Если вы размещаете объявление о продаже товара – вы должны быть готовы передать его покупателю,  и т.д. Например, нельзя продать дырку от бублика или сдать в аренду квартиру на планете Сатурн. Помните, что размещение объявления может повлечь для вас обязательство перед потенциальным покупателем заключить и исполнить сделку в соответствии с гражданским законодательством.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Если вы продали товар или ваше предложение перестало быть актуальным по другим причинам, снимите объявление с публикации как можно скорее. Не изменяйте содержание ранее опубликованного объявления – для нового предложения создайте новое объявление.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Не размещайте объявления о продаже товаров через аукцион или с торгов. Исключение: в категориях&nbsp;<em>«Недвижимость»</em>&nbsp;и&nbsp;<em>«Транспорт»</em>(кроме подкатегории<em>&nbsp;«Материал»</em>) вы можете разместить объявление о продаже через аукцион при условии, что в объявлении есть прямое указание на данное условие продажи.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Не размещайте в объявлениях информацию общего рекламного характера без конкретного предложения. По вопросам рекламы обращайтесь непосредственно к нам.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>5. Запрещено размещать повторные объявления</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Вы можете разместить только одно действующее объявление для одного товара.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Это означает, что вы не можете размещать повторные объявления (дубли) о предложении одного и того же товара в разных городах или районах.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Вы также не можете размещать повторные объявления (дубли) о предложении одного и того же товара с использованием нескольких профилей (в том числе, если вы действуете в рамках одной компании или совместного бизнеса). Исключение: в категории «<em>Недвижимость</em>» допускается одновременное размещение объекта недвижимости собственником и уполномоченным агентством. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Начните писать или нажмите / для выбора блока</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>При совпадении параметров объявления с аналогичными параметрами другого ранее размещенного объявления, более позднее объявление может быть расценено как повторное и заблокировано.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Подача объявлений происходит в течении 24 часов.<br></p>\n<!-- /wp:paragraph -->', 'Правила подачи объявлений', '', 'inherit', 'closed', 'closed', '', '1578-revision-v1', '', '', '2020-05-28 14:22:44', '2020-05-28 11:22:44', '', 1578, 'http://wordpress/1578-revision-v1/', 0, 'revision', '', 0),
