INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'New feature(s)', 'Welcome to the new WooCommerce experience! In this new release you\'ll be able to have a glimpse of how your store is doing in the Dashboard, manage important aspects of your business (such as managing orders, stock, reviews) from anywhere in the interface, dive into your store data with a completely new Analytics section and more!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-13 20:23:08', NULL, 0),
(2, 'wc-admin-add-first-product', 'info', 'en_US', 'Add your first product', 'Grow your revenue by adding products to your store. Add products manually, import from a sheet, or migrate from another platform.', 'product', '{}', 'unactioned', 'woocommerce-admin', '2020-03-13 20:23:10', NULL, 0),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-13 20:23:11', NULL, 0),
(4, 'wc-admin-orders-milestone', 'info', 'en_US', 'Поздравляем с обработкой 10 заказов!', 'Вы достигли уровня в 10 заказов! Посмотрите на свой прогресс. Для мотивации просмотрите некоторые истории успеха пользователей WooCommerce.', 'trophy', '{}', 'unactioned', 'woocommerce-admin', '2020-03-13 21:28:21', NULL, 0),
(5, 'wc-admin-mobile-app', 'info', 'en_US', 'Установите мобильное приложение Woo', 'Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2020-03-16 11:26:22', NULL, 0),
(6, 'wc-admin-store-notice-giving-feedback', 'info', 'en_US', 'Просмотрите свой результат', 'Если вам нравится WooCommerce Admin, пожалуйста, поставьте нам оценку 5 звезд. Заранее благодарим!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-17 10:35:47', NULL, 0),
(7, 'wc-admin-facebook-extension', 'info', 'en_US', 'Маркетинг на Facebook', 'Развивайте свой бизнес, ориентируясь на нужных людей и стимулируя продажи с помощью Facebook. Вы можете установить это бесплатное расширение сейчас.', 'thumbs-up', '{}', 'unactioned', 'woocommerce-admin', '2020-03-17 10:35:47', NULL, 0),
(8, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Помогите WooCommerce стать лучше, согласившись делиться данными об использовании.', 'Сбор данных об использовании позволяет нам улучшить WooCommerce. Информация о вашем магазине будет использоваться для оценки новых функций, определения качества обновлений и принятия решений о целесообразности дальнейших улучшений. Вы всегда можете зайти в <a href=\"http://wordpress/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Настройки</a> и выбрать отмену отправки ваших данных. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Читать подробнее</a> о том, какие данные мы собираем.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-03-21 08:01:10', NULL, 0);
